package smartsuite.app.common.security;

import smartsuite.security.core.crypto.RSAKeyGenerator;
/**
 * 비대칭키 암호화 알고리즘인 RSA 암호화 고정키 생성 클래스 입니다.
 * 견적 입찰용 고정키 생성
 */
public class FixedBidRSAKeyGenerator extends RSAKeyGenerator {

    private static final String MODULUS = "";

    private static final String PUBLICEXPONENT = "MTAwMDE=";

    private static final String PRIVATEMODULUS = "";

    private static final String PRIVATEEXPONENT = "";

    public FixedBidRSAKeyGenerator() {
        super(MODULUS, PUBLICEXPONENT, PRIVATEMODULUS, PRIVATEEXPONENT);
    }

}
